import axios from "axios";
import { url } from "inspector";
import { useEffect, useState } from "react";
import Pagination from "react-js-pagination";
import { IAnswer, IQuestion } from "./types";

import QuestionNote from "./QuestionNoteAnony";

export interface Props {
	questionList: IQuestion[];
	answerList: IAnswer[];
}

function AnswerForTheQuestion(element: { questionId: any; }, question: { id: any; }) {
	if (element.questionId === question.id) {
		return element;
	}
}

function QuestionNoteList(props: Props) {
	const answerList = props.answerList;
	// const answer = answerList.find(AnswerForTheQuestion(question));
	return (
		<>
			<div className="question-notes-container">
				{props.questionList.map((question, idx) => (
					// answerList.find(a => a.questionId === question.id);
					<QuestionNote key={idx} idx={idx} question={question} answer={answerList.filter(AnswerForTheQuestion)} />
				))}
			</div>
		</>
	);
}

export default QuestionNoteList;
